import styles from "./PictureUpload.module.css";
import { Icon } from "semantic-ui-react";

function PictureUpload() {
  return (
    <div className={styles.container}>
      <div>
        <Icon name="upload" />
      </div>
      <div>Upload a picture</div>
    </div>
  );
}

export default PictureUpload;
